import logo from './logo.svg';
import './App.css';
import Header from "./components/header";
import Footer from "./components/footer";
import ListOfStreams from "./components/listOfStreams";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <BrowserRouter>
        <Route path="/" exact component={ListOfStreams} />
        <Route path="/create" exact component={ListOfStreams} />
      </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
